(function($) {
  $('head').append('<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/jqueryui/1.12.1/jquery-ui.min.css" type="text/css" />');
  $.getScript("https://cdnjs.cloudflare.com/ajax/libs/jqueryui/1.12.1/jquery-ui.min.js", function() {

    window.windowRestore = function(){
      $(".minimizedTitle").remove();
      $("#content-thing").attr("style", "border:1px #000 solid;background-color:#333");
      $("body").attr("style", "background-color:#FFF;background-image:url('data:image/jpeg;base64,');background-repeat: no-repeat;background-attachment: fixed;background-position: center; ");
      $("#windowIcons").html('<a href="javascript:windowMinimize();"><i class="fa fa-window-minimize" aria-hidden="true"></i></a> ' +
          '<a href="javascript:windowMaximize();"><i class="fa fa-window-maximize" aria-hidden="true"></i></a>');

      $("#content-thing").resizable({
        alsoResize: 'canvas,img',
        disabled: false
      });
      $("#content-thing").draggable({disabled: false});
      $("#content-thing").width("50%");
    };

    window.windowMaximize = function() {
      $(".minimizedTitle").remove();
      $("body").attr("style", "background-color:#333");
      $("#windowIcons").html('<a href="javascript:windowMinimize();"><i class="fa fa-window-minimize" aria-hidden="true"></i></a> ' +
        '<a href="javascript:windowRestore();"><i class="fa fa-window-restore" aria-hidden="true"></i></a>');

      $("#content-thing").resizable({ disabled: true });
      $("#content-thing").draggable({ disabled: true });

      $("#content-thing,canvas,img").attr('style', "");
    };

    window.windowMinimize = function() {
      windowRestore();
      $("#content-thing").hide();
      $("body").prepend('<div class="minimizedTitle clearfix" style="border:1px #000 solid;background-color:#ffF;position:fixed;bottom:0;left:0;"><strong>DEF CON 225</strong><div class="pull-right" id="windowIcons">' +
    '<a href="javascript:windowRestore();"><i class="fa fa-window-restore" aria-hidden="true"></i></a> ' +
    '<a href="javascript:windowMaximize();"><i class="fa fa-window-maximize" aria-hidden="true"></i></a>' +
    '</div></div>');
    };

    
    $("#content-thing").prepend('<div class="clearfix" style="background-color:#ffF"><strong>DEF CON 225</strong> <div class="pull-right" id="windowIcons">' +
    '<a href="javascript:windowMinimize();"><i class="fa fa-window-minimize" aria-hidden="true"></i></a> ' +
    '<a href="javascript:windowRestore();"><i class="fa fa-window-restore" aria-hidden="true"></i></a>' +
    '</div></div>');
  });
}(jQuery));
